import React, { useEffect, useState } from "react";

function Welcome() {
  const [data, setData] = useState();

  useEffect(() => {
    const sendRequest = async () => {
      const res = await fetch("http://localhost:5000/api/user", {
        method: "GET",
      });

      const data = await res.json();
      setData(data);
      console.log(data);
    };

    sendRequest();
  }, [data]);

  return (
    <div>
      <h1>Welcome</h1>
    </div>
  );
}

export default Welcome;
